//index.js
// importing the react and react-dom package

import React from 'react'
import ReactDOM from 'react-dom/client'



let diameter = 150;

const profileStyle = {
    width: diameter,
    height: diameter,
    objectFit: 'cover',
    borderRadius: '50%'
}
const textStyle = {
  fontFamily: 'Arial, sans-serif',
  fontSize: '20px',
  fontWeight: 'bold',
  color: '#333'
};

// JSX element, header
const header = (
  <header>
    <div className='header-wrapper'>
      <img style={profileStyle} src="/asabeneh.jpg" alt="Profile"/>
      <p style={textStyle}>Asabeneh Yetayeh</p>
    </div>
  </header>
)

const skillStyle = {
  backgroundColor: '#00FFFF',
  color: 'white',
  padding: '8px, 14px',
  borderRadius: '6px'

}

// JSX element, main
const main = (
  <main>
    <div className='main-wrapper'>
      <p>
        Prerequisite to get started{' '}
        <strong>
          <em>react.js</em>
        </strong>
        :
      </p>
      <ul style={skillStyle}>

      </ul>
    </div>
  </main>
)

// JSX element, footer
const footer = (
  <footer>
    <div className='footer-wrapper'>
      <p>Copyright 2020</p>
    </div>
  </footer>
)

// JSX element, app
const app = (
  <div className='app'>
    {header}
    {main}
    {footer}
  </div>
)








const rootElement = document.getElementById('root')
const root = ReactDOM.createRoot(rootElement)
root.render(app)
